INSERT INTO `recipes` VALUES (1,'','carbonara',' Semplice! prendi il rosso dell\'uovo, lo sbatti insieme a un po di pecorino e pepe. Cuoci il guanciale e infine unisci guanciale e uovo nella pasta! ',1),(14586358,'','spaghetti all\'amatriciana','Eliminate la cotenna del guanciale.\\nTagliate il guanciale prima a fette, poi a bastoncini.\\nSoffriggete i bastoncini in casseruola con l\'olio e uno spicchio di aglio schiacciato.\\nUna volta evaporato il vino, unite i pomodori freschi, privati della pelle e tagliati a spicchi. Coperchiate e cuocete per 50\' circa (i tempi per variano secondo il grado di maturazione dei pomodori). Lessate i bucatini, scolateli al dente, rimetteteli nella casseruola calda e conditeli subito con il sugo.\\nServiteli immediatamente con il pecorino grattugiato e una macinata di pepe.',2),(16725246,'','aglio, olio e peperoncino','Far cuocere la pasta, in abbondante acqua salata, scolare al dente e condire in una zuppiera con un soffritto di aglio, olio e peperoncino',2);
